import React from 'react';
import styled from 'styled-components';

const StyledButton = styled.button`
  display: flex;
  align-items: center;
  background-color: #555;
  color: white;
  border: none;
  padding: 10px 20px;
  border-radius: 5px;
  cursor: pointer;

  &:hover {
    background-color: #666;
  }

  svg {
    margin-right: 8px;
  }
`;

const Button = ({ text, leftIcon }) => {
  return (
    <StyledButton>
      {leftIcon}
      {text}
    </StyledButton>
  );
};

export default Button;
